import React, { createRef, useEffect } from 'react';
import Header from '../components/Header';
import { Panel } from '../components/Panel';
import faker from 'faker';
import Link from 'next/link';

const ProfileApp = () => {
	const headerRef = createRef<HTMLDivElement>();
	const containerRef = createRef<HTMLDivElement>();

	useEffect(() => {
		containerRef.current!.style.height = `calc(100vh - ${
			headerRef.current!.getBoundingClientRect().height
		}px)`;
	}, []);

	return (
		<div className="h-full">
			<Header ref={headerRef} />
			<div
				ref={containerRef}
				className="px-12.5% py-12 overflow-hidden overflow-y-scroll"
			>
				{/* <Panel
						compact={true}
						noPadding={true}
						className="rounded-md"
						// header={{ transparent: true, content: `RiznSun's Profile` }}
					>
						<img src={faker.image.imageUrl()} className="rounded-t-md"></img>
					</Panel> */}
				<div>
					<p className="uppercase">Home / RiznSun's Profile</p>
				</div>
				<Panel
					compact={true}
					noPadding={true}
					transparent={true}
					className="mt-3"
				>
					<div className="grid grid-cols-6 gap-6">
						<Panel noPadding={true}>
							<div
								className="w-full relative overflow-hidden"
								style={{ paddingBottom: '100%' }}
							>
								<img
									src={faker.image.imageUrl()}
									className="absolute rounded-md h-full w-full object-cover"
								/>
							</div>
							<div className="p-3 flex flex-col items-center"></div>
						</Panel>
						<Panel compact={true} noPadding={true} className="col-span-5">
							<div className="p-6">
								<h3>RiznSun</h3>
								<p className="mt-1">{faker.commerce.productDescription()}</p>
							</div>
							<div className="">
								<ul className="flex items-center border-primary-color border-b-4 px-6">
									{[
										'Profile Wall',
										'Posts',
										'Contact Details',
										'Wallets',
										'Resources',
										'Reputation',
										'Business Accounts',
									].map((link, index) => {
										return (
											<li
												className={`px-4 py-3 rounded-t-md ${
													(!index &&
														'bg-primary-color text-primary-text font-medium') ||
													''
												}`}
											>
												{link}
											</li>
										);
									})}
								</ul>
								<div className="p-6">
									<ul>
										{[
											{
												name: faker.name.findName(),
												content: faker.lorem.text(),
											},
										].map((post) => {
											return (
												<li>
													{/* <p>
														From{' '}
														<Link href="/users/1">
															<a className="text-yellow-400 font-medium">
																{post.name}
															</a>
														</Link>{' '}
													</p> */}
													<div className="p-3 bg-tertiary-bg rounded-md">
														<div className="flex items-center space-x-3">
															<img
																src={faker.image.imageUrl()}
																className="w-10 h-10 rounded-sm"
															/>
															<p className="">
																<Link href="/users/1">
																	<a className="text-yellow-400 font-medium">
																		{post.name}
																	</a>
																</Link>
																<p>10 days ago</p>
															</p>
														</div>
														<p className="overflow-hidden overflow-ellipse line-clamp-4 mt-2 text-white">
															{/* {post.content} */}
															Lorem ipsum dolor sit amet, consectetur adipiscing
															elit. Proin facilisis libero sit amet lobortis
															pellentesque. Integer congue eros sit amet
															malesuada ornare. Quisque convallis suscipit
															tellus, ac feugiat nisi lobortis quis. Vestibulum
															tempor justo id posuere aliquet. Nulla maximus
															erat dolor, eget euismod dui mattis quis. Vivamus
															velit enim, sollicitudin sit amet tellus vitae,
															pulvinar lacinia arcu. Sed vel sapien in mi
															elementum lacinia. Suspendisse molestie nisl a
															eros ultrices euismod. Donec eget faucibus lacus,
															et pretium dui. Proin dui lacus, lacinia sed lacus
															molestie, tempus mollis velit. Phasellus ut
															pretium libero. Pellentesque laoreet dolor libero,
															sit amet accumsan neque placerat eu. Sed eget
															tempus turpis, nec cursus felis. Pellentesque at
															nisl ac ante maximus feugiat aliquam vitae felis.
														</p>
													</div>
												</li>
											);
										})}
									</ul>
								</div>
							</div>
						</Panel>
					</div>
				</Panel>
			</div>
		</div>
	);
};

